from Bio import Align

aligner = Align.PairwiseAligner()

aligner.mode = 'local'  # Local (Smith-Waterman) alignment; use 'global' for global (Needleman-Wunsch)
aligner.match_score = 1  # Score for a match
aligner.mismatch_score = -(1)  # Penalty for a mismatch
#aligner.mismatch_score = -float('inf')  # Penalty for a mismatch
aligner.open_gap_score = -(1)  # Penalty for opening a gap
#aligner.open_gap_score = -float('inf')  # Penalty for opening a gap
aligner.extend_gap_score = -(.1)  # Penalty for extending a gap
#aligner.extend_gap_score = -float('inf')  # Penalty for extending a gap
#aligner.query_left_open_gap_score = 0
#aligner.query_right_open_gap_score = 0
#aligner.target_left_open_gap_score = 0
#aligner.target_right_open_gap_score = 0

seq1 = ""
#seq2 = "GTGTGTGTGGGGTGTGGTGTGTGTGTGGGTGTGGGTGTGGGTGTGTGGGTGTGGTGTGTGTGGGTGTGGTGTGTGGGTGTGTGGGTGTGGTGTGTGGGTGTGGTGTGTGGGTGTGTGGGTGTGGTGTGGGTGTGGT"
#seq2 = "GTGTGTGGGTGTGGGTGTGGGTGTGTGGGTGTGGTGTGTGTGGGTGTGGTGTGTGGGTGTGTGGGTGTGGTGTGTGGGTGTGGTGTGTGGGTGTGTGGGTGTGGTGTGGGTGTGGTGTGTGTGTGGGGTGTGGTGT"
seq2 = "GTGTGTGGGTGTGGTGTGTGGGTGTGTGGGTGTGGTGTGTGGGTGTGGTGTGTGGGTGTGTGGGTGTGGTGTGGGTGTGGTGTGTGTGTGGGGTGTGGTGTGTGTGTGGGTGTGGGTGTGGGTGTGTGGGTGTGGT"

#seq1 = ""

alignments = aligner.align(seq1, seq2)


last_val = 0
str_arr = []
print(len(alignments))
for alignment in alignments:
    #print(alignment)
    coordinates = alignment.coordinates[0]
    str_arr.append(seq1[last_val:coordinates[0]])
    last_val = coordinates[1]

arr = []
for str in str_arr:
    if str != "":
    #print(str)
        alignments = aligner.align(str, seq2)
        arr.append(alignments[0].score)
print(arr)